import React from "react";
import { Navbar, Nav } from "react-bootstrap";
import "./Navbar.css";

function CustomNavbar({ user, onLoginClick, onLogout }) {
  return (
    <Navbar className="navbar-custom" expand="lg">
      <Navbar.Brand href="#" className="navbar-brand">
        IMS
      </Navbar.Brand>
      <Nav className="ms-auto">
        {user ? (
          // Logout button when the user is logged in
          <button className="btn icon-btn" onClick={onLogout}>
            <img
              src="images/icons/logout/logout-icon-32.png"
              alt="Logout"
              className="icon-img"
            />
          </button>
        ) : (
          // Login/Register button when the user is not logged in
          <button className="btn icon-btn" onClick={onLoginClick}>
            <img
              src="images/icons/login/home-login-32.png"
              alt="Login/Register"
              className="icon-img"
            />
          </button>
        )}
      </Nav>
    </Navbar>
  );
}

export default CustomNavbar;
